const classicStringConcatenation = () => {
    const stringBase = 'The answer to the problem is: ';
    const initialValue = 1;

    const addition = (a, b) => {
        return a + b;
    }

    const result = stringBase + addition(initialValue, "five");

    console.log(result);
}

const stringTemplates = () => {
    const stringBase = 'The answer to the problem is: ';
    const initialValue = 0;

    const additionValues = [0,1,2,3,4,5,6,7];
    const addition = (a,b) => a + b;

    console.log(`${stringBase} ${additionValues.reduce(addition, initialValue)}`);
}

const ternaries = () => {

    const equipment = ['ball','net','net','water cooler','flag','flag','flag','flag']
    const equipmentCheck = equipment.reduce((item, result) => { item[result] = (item[result] || 0) + 1 ; return item;} , {});

    console.log(equipmentCheck.ball >= 1 ? "We have a ball" : "We need a ball");
    console.log(equipmentCheck.net >= 2 ? "We have enough nets" : "We need more nets");

    console.log(equipmentCheck.ball === 1 ? `We have ${equipmentCheck.ball} ball` : "We need a ball");
    console.log(equipmentCheck.net >= 2 ? `We have ${equipmentCheck.net} nets` : "We need more nets");

}

const objectLiterals = () =>{
    const createGreetingCard = (
        nameTo,
        nameFrom,
        opening,
        closing,
        message) => (
        {
            nameTo,
            nameFrom,
            opening,
            closing,
            message
        }
    );

    const newGreeting = createGreetingCard("Ember", "Woody", "Dear,", "Love,", "You're my favorite Deputy");

    console.log(newGreeting);
    console.log(newGreeting.nameTo);

}

const spreadAndRest = () => {
    const stringBase = 'The answer to the problem is: ';
    const initialValue = 0;
    const reducer = (previousValue, currentValue) => previousValue + currentValue;

    const addition = (...numbers) => {
        return numbers.reduce(reducer, initialValue);
    }

    const result = stringBase + addition(1,2,3,4,5,6,100,200,300,500);

    // console.log(result);

    const listOfNumbers = [1,2,3,4,5,6,100,200,300,500];
    const copyOfListOfNumbers = [...listOfNumbers];
    console.log({listOfNumbers});
    console.log({copyOfListOfNumbers});

    // console.log(...listOfNumbers);
    // outputs only our numbers 1,2,3,4,5,6,100,200,300,500

    const resultWithSpread = stringBase + addition(20,30,40,50,60, ...listOfNumbers);

}

const destructureArray = () => {
    const manufacturers = ['Ford', 'BMW', 'KIA', 'Dodge', 'Mercedes', 'Lincoln', 'Audi'];

    const [ manufacturer, ...more ] = manufacturers;

    console.log(manufacturer);
    console.log(more);
    console.log(`${manufacturer} and ${more.length} more manufacturers`);
}

export {
    classicStringConcatenation,
    stringTemplates,
    ternaries,
    objectLiterals,
    spreadAndRest,
    destructureArray
}
